import React from "react";
import classes from "../header/header.module.css";
const header = () => (
  <header className={classes.Header}>
    <h1>
      This is header. I thought it would be better to use slide show of multiple
      images related to finance here. Feel free to modify this.
      <br></br>
      <br></br>
      <h4>
        We can use Logo at the top-left of the header. We can decide this as we
        move on
      </h4>
    </h1>
  </header>
);
export default header;
